// DestroyBushMimic.js
import React, { useEffect } from 'react';

const DestroyBushMimic = ({ x, y }) => {
  useEffect(() => {
    console.log(`Destroyed bush at X: ${x}, Y: ${y}, Timestamp: ${Date.now()}`);
  }, [x, y]);

  return <div className="destroy-bush-mimic"></div>;
};

export default DestroyBushMimic;
